import React, { PureComponent } from 'react';
import  "../../../util";
import ReturnIcon from "./img/returnIcon.png"
import RefreshIcon from "./img/refreshIcon.png"
import WholeIcon from "./img/wholeIcon.png"
import TitleDropDown from "./TitleDropDown1.js"
import "./Title.css"
import { Menu, Dropdown, Button, Icon } from 'antd';


export default class TitleCompent extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {	
        }; 
		
    }
	handleMenuClick(event) {
		
	}
	
	 menu = ()=> (
		<Menu onClick={this.handleMenuClick}>
			<Menu.Item key="1">
			  <Icon type="user" />
			  能耗计量
			</Menu.Item>
			<Menu.Item key="2">
			  <Icon type="user" />
			  楼宇自控
			</Menu.Item>
			<Menu.Item key="3">
			  <Icon type="user" />
			  报警故障管理
			</Menu.Item>
		</Menu>
	)

    render() {
        return (
            <div id="title">
				<div className="icon">
					<img src={ReturnIcon}/>
					<img src={RefreshIcon}/>
					<img src={WholeIcon}/>
				</div>
				<div className="menue">
                    <Dropdown overlay={this.menu}>
					  <Button>
						Button <Icon type="down" />
					  </Button>
					</Dropdown>
				</div>	
            </div>
        );
    }
}
